from math import isqrt
def c(n): return len(set(str(n))) == 10
def a(n):
    lb = isqrt(10**(n-1)) if n&1 else isqrt(10**(n-1)) + 1
    return sum(1 for k in range(lb, isqrt(10**n-1)+1) if c(k*k))
